import Footer from "../Footer/Footer";
import Navbar from "../Navbar/Navbar";
import { Outlet } from "react-router-dom";

function Layout() {
    return (
        <>
            <Navbar />
            <div className="position-sticky bottom-0 start-0 end-0">
                <Outlet />
            </div>
            <Footer />
        </>
    );
}

export default Layout;
